import React from "react";
import styled from "styled-components";

const FooterBG = styled.div`
  display: flex;
  width: 100%;
  height: 500px;
  background: #685c82;
`;
const Texto = styled.div`
display:flex;
flex-direction: column;
justify-content:center;
`

const FimTexto = styled.div`
  font-family: Nunito;
  font-weight: bold;
  font-size: 32px;
  line-height: 38.4px;
  text-align: left;
  color: #fff;
`;

const Footer = () => {
  return (
    <FooterBG>
        <Texto>
      <FimTexto>FIM DO TESTE</FimTexto>
      <FimTexto>
        TesteInovação é uma marca fictícia com a única finalidade de servir como
        material de estudo da equipe de inovação do Grupo Comunique-se.
      </FimTexto>
      <FimTexto>IMPORTANTE: Não compartilhe esse teste.</FimTexto>
      </Texto>
    </FooterBG>
  );
};

export default Footer;
